import React, { useEffect } from 'react';
import Wikiapi from ''

const Card = () => {

    useEffect(() => {
        async () => {
            const wiki = new Wikiapi('en');
            let page_data = await wiki.page('The_Fool_(Tarot_card)');
            console.log(page_data);
        }
    });
    return (
        <>
            <div>
                <p></p>
                <h3>Card Name</h3>
                <p></p>
            </div>
        </>
    );
}

export default Card;
